import React from 'react';

import { makeStyles } from '@material-ui/core/styles';
import {
    Grid,
    Typography,
} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    tech: {
        padding: 20,
        height: '150vh',
        backgroundColor: 'white',
    },
    header: {
        color: '#0000a2',
    },
    techText: {
        color: '#0000a2',
    },
}));

const Home = () => {

    const classes = useStyles();

    return (
        <Grid className={classes.tech} item xs={12}>

            <Typography
                className={classes.header}
                variant="h6"
                align="center"
            >
                We develop web, mobile and software applications 
                that allow our customers to gain market share
            </Typography>

            <Typography
                className={classes.techText}
                variant="body1"
                align="center"
            >
                The most used front-end frameworks are React and Material-UI
            </Typography>

        </Grid>
    );
};

export default Home;
